import PropTypes from 'prop-types';
import './style/style.css'

const Name = ({mess, name, title , status }) => {     
     const state = {
        demo: title,
        demo2: name,
        demo3: status,
        demo4: mess,
    }
    const {demo,demo2,demo3,demo4} = state;
    return (
        <div className="taskItem border  mx-3">
           <label> Title: {demo}</label><br></br>
           <label> Creator {demo2}</label><br></br>
           <label> Status {demo3}</label><br></br>  
           <p>
            Desscription: {demo4}
           </p>
      </div>
    );
};

